                            <Card.Title><strong>{username}</strong></Card.Title>
                            <Card.Body className="myBio">
                                <Card.Text>
                                {bio}
                                </Card.Text>
                            </Card.Body>
                            </Card>
                    </div>

                )
            })} */}

            {posts.map((myposts) => {
                const {post_pic} = myposts

            return (
                <Row>
                <Col lg={3}>
                    <div><img src={post_pic} className="feedPics" alt="feed pic"/>
                    </div>
                </Col>
                </Row>
                )
            })}
        </div>
    );
}

export default HomeFeed;
